sap.ui.define([
    "sap/ui/core/mvc/Controller",
    "sap/m/MessageBox",
    "vendormanagement/model/formatter"
],
    function (Controller, MessageBox, formatter) {
        "use strict";

        return Controller.extend("vendormanagement.controller.object", {

            formatter: formatter,

            onInit: function () {

                var oRouter = sap.ui.core.UIComponent.getRouterFor(this);
                oRouter.getRoute(
                    "Targetobject"
                ).attachMatched(this._onObjectMatched, this);

                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();
                const oModel = new sap.ui.model.json.JSONModel({
                    payload: {

                        companyname: "",
                        phone: "",
                        email: "",
                        grade: {
                            "mid": null
                        },
                        stage: {
                            "mid": null
                        },
                        industry: {
                            "mid": null
                        },
                        subindustry: {
                            "mid": null
                        },
                        code: "",

                        // Vendor Address Details

                        issbasame: false, // Is Shiping and billing addresses same ?

                        billingAddress: "",
                        bilingcity: "",
                        billingstate: "",
                        billingzip: "",
                        billingcountry: "",
                        shippingAddress: "",
                        shippingcity: "",
                        shippingstate: "",
                        shippingzip: "",
                        shippingcountry: "",
                        objectFlag: true

                    },
                    contact: {
                        name: "",
                        title: "",
                        email: "",
                        phone: "",
                        vendor_ID: ""
                    },
                    product:{
                        vendor_ID: "",
                        name :"",
                        image:"",
                        family:"",
                        code:"",
                        currency:"",
                        price:""
                    },
                    headerExpanded: true,
                    stageKeys: [],
                    Stages: [],
                    Grades: [],
                    Industries: [],
                    SubIndustries: [],
                    AllSubIndustries: [],
                    logo: "data:image/png+xml;base64,"
                });

                this.getView().setModel(oModel, 'oModel');

                let Stages = this.getView().getModel('oModel').getProperty('/Stages')

                $.ajax({
                    type: "GET",
                    url: serviceUrl + "Stages",
                    success: function (response, statusText, xhrToken) {

                        for (var i = 0; i < response.value.length; i++) {

                            Stages[response.value[i].mid] = response.value[i].text;

                        }

                        oModel.setProperty('/Stages', Stages);

                    },
                    contentType: "application/json"
                });

                let Industries = this.getView().getModel('oModel').getProperty('/Industries');

                $.ajax({
                    type: "GET",
                    url: serviceUrl + "Industries",
                    success: function (response, statusText, xhrToken) {

                        for (var i = 0; i < response.value.length; i++) {

                            Industries[response.value[i].mid] = response.value[i].text;

                        }

                        oModel.setProperty('/Industries', Industries);

                    },
                    contentType: "application/json"
                });

                let AllSubIndustries = this.getView().getModel('oModel').getProperty('/AllSubIndustries');

                $.ajax({
                    type: "GET",
                    url: serviceUrl + "SubIndustries",
                    success: function (response, statusText, xhrToken) {

                        for (var i = 0; i < response.value.length; i++) {

                            AllSubIndustries[response.value[i].mid] = response.value[i].text;

                        }

                        oModel.setProperty('/AllSubIndustries', AllSubIndustries);
                        oModel.setProperty('/SubIndustries', AllSubIndustries);

                    },
                    contentType: "application/json"
                });

                let Grades = this.getView().getModel('oModel').getProperty('/Grades');

                $.ajax({
                    type: "GET",
                    url: serviceUrl + "Grades",
                    success: function (response, statusText, xhrToken) {

                        for (var i = 0; i < response.value.length; i++) {

                            Grades[response.value[i].mid] = response.value[i].text;

                        }

                        oModel.setProperty('/Grades', Grades);

                    },
                    contentType: "application/json"
                });

            },
            _onObjectMatched: function (oEvent) {

                //fetching data of the vendor
                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();
                var ID = oEvent.getParameters().arguments.ID;
                const that = this;

                $.ajax({
                    type: "GET",
                    contentType: "application/json",
                    url: serviceUrl + '/Vendors(' + ID + ')?$expand=grade,stage,industry,subindustry,contacts,products',
                    success: function (response, statusText, xhrToken) {

                        that.getView().getModel("oModel").setProperty('/payload', response);

                    },
                    contentType: "application/json"
                });

            },
            navBack: function () {
                window.history.go(-1);
            },
            onPressEdit: function () {

                if (!this.valueHelp) {
                    this.valueHelp = sap.ui.xmlfragment("vendormanagement.fragments.vendorFrag", this);
                }
                this.getView().addDependent(this.valueHelp);
                this.valueHelp.open();

            },
            closeFragment: function () {

                if (!this.valueHelp) {
                    this.valueHelp = sap.ui.xmlfragment("vendormanagement.fragments.vendorFrag", this);
                }
                this.getView().addDependent(this.valueHelp);
                this.valueHelp.close();

            },
            onFragCancel: function () {

                const that = this;

                MessageBox.warning("Unsaved data will be lost, are you sure?", {
                    actions: [MessageBox.Action.OK, MessageBox.Action.CANCEL],
                    emphasizedAction: MessageBox.Action.OK,
                    onClose: function (sAction) {
                        if (sAction === 'OK') {
                            that.closeFragment();
                        }
                    },
                    dependentOn: this.getView()
                });

            },
            onIndustryChange: function () {

                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();

                let oModel = this.getView().getModel('oModel');
                const industry = oModel.getProperty('/payload/industry/mid');
                oModel.setProperty('/payload/subindustry/mid', "");

                // Fetching relevent subindustry data

                $.ajax({
                    type: "GET",
                    url: serviceUrl + "Industries?$filter=mid eq " + industry + "&$expand=subindustry",
                    success: function (response, statusText, xhrToken) {

                        oModel.setProperty('/SubIndustries', response.value[0].subindustry);

                    },
                    contentType: "application/json"
                });

            },
            patchVendorData: function () {

                const that = this;
                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();
                const oModel = this.getView().getModel('oModel');
                let payload = oModel.getProperty('/payload');
                payload.stage.mid = parseInt(payload.stage.mid);
                payload.grade.mid = parseInt(payload.grade.mid);
                payload.industry.mid = parseInt(payload.industry.mid);
                payload.subindustry.mid = parseInt(payload.subindustry.mid);

                // Posting Data

                $.ajax({
                    type: "PATCH",
                    url: serviceUrl + "Vendors(" + payload.ID + ")",
                    data: JSON.stringify(payload),
                    success: function (response, statusText, xhrToken) {

                        MessageBox.success("Saved Successfully.");
                        // sap.ui.getCore().byId("table").getBinding("items").refresh();
                        //that.getView().getElementBinding().refresh(true);

                    }, error: function (e) {
                        MessageBox.error("ooppss..");
                        console.log(e);
                    },
                    contentType: "application/json"
                });

            },
            onPressSave: function () {

                this.patchVendorData();
                this.closeFragment();

            },
            onPressAddContact: function () {

                if (!this.contact) {
                    this.contact = sap.ui.xmlfragment("vendormanagement.fragments.contact", this);
                }
                this.getView().addDependent(this.contact);
                this.contact.open();

            },
            closeContactFragment: function () {

                if (!this.contact) {
                    this.contact = sap.ui.xmlfragment("vendormanagement.fragments.contact", this);
                }
                this.getView().addDependent(this.contact);
                this.contact.close();

            },
            postContactData: function () {

                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();

                const payload = this.getView().getModel('oModel').getProperty('/contact');
                const vendor_ID = this.getView().getModel('oModel').getProperty('/payload/ID');
                payload.vendor_ID = vendor_ID;

                if (payload.ID !== undefined && payload.ID !== null && payload.ID !== "") {

                    $.ajax({
                        type: "PATCH",
                        url: serviceUrl + "Contacts(" + payload.ID + ")",
                        data: JSON.stringify(payload),
                        success: function (response, statusText, xhrToken) {

                            MessageBox.success("Saved Successfully.");
                            // sap.ui.getCore().byId("table").getBinding("items").refresh();
                            //that.getView().getElementBinding().refresh(true);

                        }, error: function (e) {
                            MessageBox.error("ooppss..");
                            console.log(e);
                        },
                        contentType: "application/json"
                    });

                } else {

                    $.ajax({
                        type: "POST",
                        url: serviceUrl + "Contacts",
                        data: JSON.stringify(payload),
                        success: function (response, statusText, xhrToken) {

                            MessageBox.success("Saved Successfully.");
                            // sap.ui.getCore().byId("table").getBinding("items").refresh();
                            //that.getView().getElementBinding().refresh(true);

                        }, error: function (e) {
                            MessageBox.error("ooppss..");
                            console.log(e);
                        },
                        contentType: "application/json"
                    });

                }

                this.refreshdata();

            },
            onPressSaveContact: function () {

                this.postContactData();
                this.closeContactFragment();
                this.getView().getModel('oModel').setProperty('/contact', {
                    "name": "",
                    "title": "",
                    "email": "",
                    "phone": ""
                })

            },
            onPressEditContact : function(oEvent){
            
                this.getView().getModel('oModel').setProperty('/contact',oEvent.getSource().getBindingContext('oModel').getObject());
                this.onPressAddContact();

            },
            refreshdata : function(){

                //fetching data of the vendor
                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();
                var ID = this.getView().getModel('oModel').getProperty('/payload/ID');
                const that = this;

                $.ajax({
                    type: "GET",
                    contentType: "application/json",
                    url: serviceUrl + '/Vendors(' + ID + ')?$expand=grade,stage,industry,subindustry,contacts,products',
                    success: function (response, statusText, xhrToken) {

                        that.getView().getModel("oModel").setProperty('/payload', response);

                    },
                    contentType: "application/json"
                });

            },
            onPressAddProduct : function(){

                if (!this.product) {
                    this.product = sap.ui.xmlfragment("vendormanagement.fragments.product", this);
                }
                this.getView().addDependent(this.product);
                this.product.open();

            },
            closeProductFrag : function(){

                if (!this.product) {
                    this.product = sap.ui.xmlfragment("vendormanagement.fragments.product", this);
                }
                this.getView().addDependent(this.product);
                this.product.close();

                this.getView().getModel('oModel').setProperty('/product', {
                    vendor_ID: "",
                    name :"",
                    image:"",
                    family:"",
                    code:"",
                    currency:"",
                    price:""
                });

            },
            onPressEditContact : function(oEvent){
            
                this.getView().getModel('oModel').setProperty('/product',oEvent.getSource().getBindingContext('oModel').getObject());
                this.onPressAddProduct();

            },
            postProductData: function () {

                const serviceUrl = this.getOwnerComponent().getModel().getServiceUrl();

                const payload = this.getView().getModel('oModel').getProperty('/product');
                const vendor_ID = this.getView().getModel('oModel').getProperty('/payload/ID');
                payload.vendor_ID = vendor_ID;

                if (payload.ID !== undefined && payload.ID !== null && payload.ID !== "") {

                    $.ajax({
                        type: "PATCH",
                        url: serviceUrl + "Products(" + payload.ID + ")",
                        data: JSON.stringify(payload),
                        success: function (response, statusText, xhrToken) {

                            MessageBox.success("Saved Successfully.");
                            // sap.ui.getCore().byId("table").getBinding("items").refresh();
                            //that.getView().getElementBinding().refresh(true);

                        }, error: function (e) {
                            MessageBox.error("ooppss..");
                            console.log(e);
                        },
                        contentType: "application/json"
                    });

                } else {

                    $.ajax({
                        type: "POST",
                        url: serviceUrl + "Products",
                        data: JSON.stringify(payload),
                        success: function (response, statusText, xhrToken) {

                            MessageBox.success("Saved Successfully.");
                            // sap.ui.getCore().byId("table").getBinding("items").refresh();
                            //that.getView().getElementBinding().refresh(true);

                        }, error: function (e) {
                            MessageBox.error("ooppss..");
                            console.log(e);
                        },
                        contentType: "application/json"
                    });

                }

                this.refreshdata();

            },
            onPressSaveProduct : function(){

                this.postProductData();
                this.closeProductFrag();
                
            },
            onPressSaveNewProduct : function(){
                this.postProductData();
                this.getView().getModel('oModel').setProperty('/product', {
                    vendor_ID: "",
                    name :"",
                    image:"",
                    family:"",
                    code:"",
                    currency:"",
                    price:""
                });
            }

        });
    });
